import React from 'react';
import Logo from ".././img/Home Link_logo.jpg";

class Button extends React.Component{
  render() {
    return(
     <div className="button">
       <img className="logo" src={Logo} alt="Logo" />
       <button className="button1" type="submit" value="About">About</button>
       <button className="button2" type="submit" value="News">News</button>
       <button className="button3" type="submit" value="Members">Members</button>
       <button className="button4" type="submit" value="Contact">Contact</button>
     </div>
    );
  }
}

export default Button;
